import React from 'react'
import styled from 'styled-components'
import Styled from 'styled-components'

function Header() {
  return (
    
     

      
    <Nav>
      <Logo src="/images/Logo.svg"/>

      <NavMenu>
        <a>
          <img src="images/home-icon.svg"/>
          <span>HOME</span>
        </a>

      
      </NavMenu>

    </Nav>

  
  )
}

export default Header

const Nav=styled.div`
height:70px;
background-color:#090b13; 
display:flex;
align-item:center;
padding:0 36px;

`
const ItemText=styled.div`
color:white;
display:flex;
cursor:pointer;
align-item:center;
`
const Logo=styled.img`
`
const NavMenu=styled.div`
display:flex;

a{
  display:flex;
  align-items:center;
  padding:0 12px;
  
  img{
    height:20px;
  }
  span{
    font-size:13px;
  
  }


}
`
